output=$(curl \
  --header "Authorization: Bearer ${TOKEN}" \
  --header "Content-Type: application/vnd.api+json" \
  --request POST \
  --data @payload.json \
  ${TF_VAR_ATLAS_ADDRESS}/api/v2/organizations/${ORGANIZATION}/teams)
  echo $output | jq '. | {id: .data.id}' -cj

